import React from 'react';



interface IProps{

}
interface IState{
msg:String;
}
class WishMessage extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
        this.state ={msg:'hello'}
        
    }
    //saystart
    saystart=()=>{
        //alert('its working')
        this.setState(
            {
                msg:'start'
                
            }
        )
    
        
        }
    

    
    //saystop
    sayresume=()=>{
       // alert('its working')
       this.setState(
           {
               msg:'resume'
           }
       )
    }
    saystop=()=>{
        this.setState(
            {
                msg:'stop'
            }
        )
    }
    
    render()
    {
        return(
<React.Fragment>
    <section className='mt-5'>
        <div className='container'>
            <div className='row'>
                <div className='col-md-5'>
                    <div className='card'>
                        <h3>{this.state.msg}</h3>
                        <div className='card-body bg-secondary text-white'>
                            <button className='btn btn-success md'onClick={this.saystart} >Start</button>
                            <button className='btn btn-warning md'onClick={this.sayresume}>Resume</button>
                            <button className='btn btn-danger md'onClick={this.saystop}>Stop</button>

                        </div>
                    </div>
                </div>
            </div>

        </div>

    </section>
</React.Fragment>
        )
    }
};
export default WishMessage;
